//https://leetcode.com/problems/minimum-cost-path-with-alternating-directions-ii
class Solution {
public:
    long long minCost(int m, int n, vector<vector<int>>& waitCost) {
        vector<vector<long long>> entryCost(waitCost.size(), vector<long long>(waitCost[0].size(), 0));

        vector<vector<long long>> cost(waitCost.size(), vector<long long>(waitCost[0].size(), LLONG_MAX));
        
        for(int i=0; i<waitCost.size(); i++){
            for(int j=0; j<waitCost[0].size(); j++){
                entryCost[i][j] = (i+1)*(j+1);
            }
        }

        priority_queue<tuple<long long, int, int>, vector<tuple<long long, int, int>>, greater<tuple<long long, int, int>>> pq;
        vector<vector<bool>> visit(waitCost.size(), vector<bool>(waitCost[0].size(), false));
        pq.push({entryCost[0][0], 0, 0});
        cost[0][0] = entryCost[0][0];
        
        while(!pq.empty()){
            auto [sum, i, j] = pq.top();
            pq.pop();
            if(visit[i][j])
                continue;
            visit[i][j] = true;
            
            if((i+1) < waitCost.size()){
                long long total = sum+waitCost[i+1][j]+entryCost[i+1][j];
                if(total < cost[i+1][j]){
                    cost[i+1][j] = total;
                    pq.push({total, i+1, j});
                }
            }

            if((j+1) < waitCost[0].size()){
                long long total = sum+waitCost[i][j+1]+entryCost[i][j+1];
                if(total < cost[i][j+1]){
                    cost[i][j+1] = total;
                    pq.push({total, i, j+1});
                }
            }
        }

        return cost[m-1][n-1] - waitCost[m-1][n-1];
    }
};

